      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "hardhat/console.sol";
import "./ERC1155Claimable.sol";

/**
 * @title CmorqClaimableV2
 * CmorqClaimableV2 - ERC1155 contract with claim functionality
 */
contract CmorqClaimableV2 is ERC1155Claimable, Ownable {
    using Strings for string;

    // Name of the collection
    string public name;

    // Symbol of the collection
    string public symbol;

    // Current-highest collectible id for the collection
    uint256 public currentCollectibleID = 0;

    // Current supply of a specific collectible
    mapping(uint256 => uint256) public collectibleSupply;

    // Total supply of a specific collectible
    mapping(uint256 => uint256) public totalCollectibleSupply;

    // Collection of Arweave token URIs to fully-decentralize metadata storage
    mapping(uint256 => string) private _uris;

    constructor(string memory _name, string memory _symbol) ERC1155("") {
        name = _name;
        symbol = _symbol;
    }

    /**
     * @dev Mints some amount of collectibles to an address
     * @param _to          Address of the future owner of the collectible
     * @param _id          Collectible ID to mint
     * @param _quantity    Amount of collectibles to mint
     * @param _data        Data to pass if receiver is contract
     */
    function mint(
        address _to,
        uint256 _id,
        uint256 _quantity,
        bytes memory _data
    ) public onlyOwner {
        require(
            _quantity + collectibleSupply[_id] <= totalCollectibleSupply[_id],
            "AssetContract#_beforeMint: QUANTITY_EXCEEDS_COLLECTIBLE_SUPPLY_CAP"
        );
        _mint(_to, _id, _quantity, _data);
        collectibleSupply[_id] = collectibleSupply[_id] + _quantity;
    }

    /**
     * @dev Creates a new collectible and assigns _initialSupply to an address
     * @param _initialSupply amount to supply the first owner
     * @param _totalSupply total amount possible to create
     * @param _uri URI for this token
     * @param _data Data to pass if receiver is contract
     * @return id The newly created collectible ID
     */
    function create(
        uint256 _initialSupply,
        uint256 _totalSupply,
        string calldata _uri,
        bytes calldata _data
    ) external onlyOwner returns (uint256) {
        uint256 _id = currentCollectibleID + 1;
        currentCollectibleID++;

        if (bytes(_uri).length > 0) {
            emit URI(_uri, _id);
        }

        // Mint _initialSupply to contract creator
        _mint(_msgSender(), _id, _initialSupply, _data);

        // Set token URI
        _setTokenUri(_id, _uri);

        collectibleSupply[_id] = _initialSupply;
        totalCollectibleSupply[_id] = _totalSupply;
        return _id;
    }

    function _setTokenUri(uint256 collectibleID, string calldata tokenURI)
        private
    {
        require(
            bytes(_uris[collectibleID]).length == 0,
            "Cannot set uri twice"
        );
        _uris[collectibleID] = tokenURI;
    }

    function uri(uint256 collectibleID)
        public
        view
        override
        returns (string memory)
    {
        return (_uris[collectibleID]);
    }
}
"
